import Video from '../components/video';

const AboutPage = () => {
  return (
    <div>
      <h1>About Page</h1>
      <p>Learn more about us on this page.</p>
      <button> Load Video </button>
      <Video/>
    </div>
  );
};

export default AboutPage;
